<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Draws the Bar Chart of the vcolumn based on an aggregation.</p>
<h3 id="Parameters">Parameters<a class="anchor-link" href="#Parameters">&#182;</a></h3><table id="parameters">
    <tr> <th>Name</th> <th>Type</th> <th>Optional</th> <th>Description</th> </tr>
    <tr> <td><div class="param_name">method</div></td> <td><div class="type">str</div></td> <td><div class = "yes">&#10003;</div></td> <td>The method used to aggregate the data.<br>
                                                    <ul>
                                                        <li><b>count :</b> Number of elements.</li>
                                                        <li><b>density :</b> Percentage of the distribution.</li>
                                                        <li><b>mean :</b> Average of the vcolumn 'of'.</li>
                                                        <li><b>min :</b> Minimum of the vcolumn 'of'.</li>
                                                        <li><b>max :</b> Maximum of the vcolumn 'of'.</li>
                                                        <li><b>sum :</b> Sum of the vcolumn 'of'.</li>
                                                        <li><b>q% :</b> q Quantile of the vcolumn 'of' (ex: 50% to get the median).</li>
                                                        </ul></td> </tr>
    <tr> <td><div class="param_name">of</div></td> <td><div class="type">str</div></td> <td><div class = "yes">&#10003;</div></td> <td>The vcolumn used to compute the aggregation.</td> </tr>
    <tr> <td><div class="param_name">max_cardinality</div></td> <td><div class="type">int</div></td> <td><div class = "yes">&#10003;</div></td> <td>Maximum number of the vcolumn distinct elements to be used as categorical (No h will be picked or computed)</td> </tr>
    <tr> <td><div class="param_name">bins</div></td> <td><div class="type">int</div></td> <td><div class = "yes">&#10003;</div></td> <td>Number of bins. If empty, an optimized number of bins will be computed.</td> </tr>
    <tr> <td><div class="param_name">h</div></td> <td><div class="type">float</div></td> <td><div class = "yes">&#10003;</div></td> <td>Interval width of the bar. If empty, an optimized h will be computed.</td> </tr>
    <tr> <td><div class="param_name">color</div></td> <td><div class="type">str</div></td> <td><div class = "yes">&#10003;</div></td> <td>Histogram color.</td> </tr>
</table>
</div>
</div>
</div>
